import React, { Component } from 'react';
import '../css/Main.css';

class Main extends Component {
    render() {
        return(
            <div className="main" id="main">
                <div>
                    <h1>Hi, I'm Dakota</h1>
                    <p>Nice to meet you</p>
                </div>
            </div>
        );
    }
}

export default Main;
